def my_func(input1: str):
    if not 1 <= len(input1) <= 20:
        return None

    parts = input1.split(' ')
    for i, part in enumerate(parts):
        sub_parts = part.split('-')
        for j in range(1, len(sub_parts)):
            sub_parts[j] = sub_parts[j].capitalize()
        parts[i] = ''.join(sub_parts)

    return ' '.join(parts)
